# frozen_string_literal: true

require "rails_helper"
RSpec.describe("Upload Canvas") do
  before do
    @user = create(:user, email: "user@email.com", username: "something", password: "1234")
    prepare_query_variables({})
    prepare_context({})
  end

  describe Mutations::Images::UploadCanvas do
    it "if conditions are valid, image is succesfully created" do
      prepare_context({
        current_user: @user,
      })

      query = <<~GRAPHQL
        mutation uploadCanvas($title: String!, $description: String!, $price: Int!, $dataUri: String!) {
          uploadCanvas(title: $title, description: $description, price: $price, dataUri: $dataUri){
              id
          }
        }
        GRAPHQL

      prepare_query(query)

      data_uri = "data:image/png;base64,"

      prepare_query_variables(
        title: "Test Image",
        description: "...",
        price: 100,
        dataUri: data_uri
      )
      result = graphql!
      expect(result["data"]["uploadCanvas"]["id"].to_i).to(eq(Image.last.id))
    end

    it "if conditions are valid, image is succesfully created" do
      query = <<~GRAPHQL
        mutation uploadCanvas($title: String!, $description: String!, $price: Int!, $dataUri: String!) {
          uploadCanvas(title: $title, description: $description, price: $price, dataUri: $dataUri){
              id
          }
        }
        GRAPHQL

      prepare_query(query)

      data_uri = "data:image/png;base64,"

      prepare_query_variables(
        title: "Test Image",
        description: "...",
        price: 100,
        dataUri: data_uri
      )
      result = graphql!
      expect(result["errors"][0]["message"]).to(eq("ERROR: Not logged in or missing token"))
    end
  end
end
